export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},hCtk838BLp:{data:{id:481,attributes:{imdbId:"tt0783233",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMGRiYjE0YzItMzk3Zi00ZmYwLWJjNDktYTAwYjIwMjIxYzM3XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.8\u002F10"},{Source:"Rotten Tomatoes",Value:"83%"},{Source:"Metacritic",Value:"85\u002F100"}],item_lang:{data:{id:1144,attributes:{title:b,plot:"When Briony Tallis (Saoirse Ronan), thirteen-years-old and an aspiring writer, sees her older sister Cecilia (Keira Knightley) and Robbie Turner (James McAvoy) at the fountain in front of the family estate, she misinterprets what is happening, thus setting into motion a series of misunderstandings and a childish pique that will have lasting repercussions for all of them. Robbie is the son of a family servant toward whom the family has always been kind. They paid for his time at Cambridge and now he plans on going to medical school. After the fountain incident, Briony reads a letter intended for Cecilia and concludes that Robbie is a deviant. When her cousin Lola (Juno Temple) is raped, she tells the Police that it was Robbie she saw committing the deed.",slug:"atonement"}}},books:{data:[{id:3726,attributes:{title:b,description:"In 1935 England, thirteen-year-old Briony Tallis witnesses an event involving her sister Cecilia and her childhood friend Robbie Turner, and she becomes the victim of her own imagination, which leads her on a lifelong search for truth and absolution. Reissue. (A Focus Features film, written by Christopher Hampton, directed by Joe Wright, releasing Fall 2007, starring Keira Knightley, James McAvoy, Brenda Blethyn, Vanessa Redgrave, & Romola Garai) (General Fiction)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ROLN1iofNbUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:true,published:"2007-01-01",publisher:h,subtitle:i}},{id:3727,attributes:{title:b,description:"The new novel by the Booker prize winner depicts love, war, class and childhood in England while exploring shame and forgiveness and the possibility of absolution.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=d3fo20vUHekC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:e,published:"2007-11-27",publisher:"Seal Books",subtitle:f}},{id:3728,attributes:{title:"Vintage Lies: What Maisie Knew & Atonement",description:"2 classic books for the price of 1: Vintage Lies is a limited edition gift pack which consists of beautifully designed separate volumes ofWhat Maisie Knewby Henry James and Ian McEwan's million-copy selling bestsellerAtonement. Vintage Lies is just one of ten Vintage Classic Twins to collect. Each twin consists of two books: a specially designed limited edition of one modern classic title and one established classic work. The books in each pair have been carefully selected to provide a thought-provoking combination. What Maisie Knew:Caught in the crossfire of her parents' acrimonious divorce, witness to their battles, intrigues and affairs, neglected and exploited, Maisie is a child who knows too much about the world of adults. James's portrait of a little girl who maintains her goodness and dignity in the face of the bitterness and profligacy of her warring parents is inspiring. Atonement: On the hottest day of the summer of 1934, thirteen-year-old Briony Tallis sees her sister Cecilia strip off her clothes and plunge into the fountain in the garden of their country house. Watching her is Robbie Turner, her childhood friend. By the end of that day, the lives of all three will have been changed for ever. Briony will have witnessed mysteries, and committed a crime for which she will spend the rest of her life trying to atone.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JluGIgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Henry James And Ian Mcewan","Henry James"],firstBook:e,published:"2007-08-01",publisher:"Vintage",subtitle:f}},{id:3729,attributes:{title:b,description:"NATIONAL BESTSELLER • A symphonic novel of love and war, childhood and class, guilt and forgiveness that provides all the satisfaction of a brilliant narrative and the provocation we have come to expect from the acclaimed Booker Prize winning, international bestselling author On a hot summer day in 1935, thirteen-year-old Briony Tallis witnesses a moment’s flirtation between her older sister, Cecilia, and Robbie Turner, the son of a servant and Cecilia’s childhood friend. But Briony’ s incomplete grasp of adult motives—together with her precocious literary gifts—brings about a crime that will change all their lives. As it follows that crime’s repercussions through the chaos and carnage of World War II and into the close of the twentieth century, Atonement engages the reader on every conceivable level, with an ease and authority that mark it as a genuine masterpiece.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pX6lBs7Q0MEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2003-05-20",publisher:h,subtitle:i}},{id:3730,attributes:{title:b,description:"Ian McEwan's poignant tale of family secrets, memory, guilt and forgiveness is read by Carole Boyd. On the hottest day of the summer of 1935, thirteen-year-old Briony Tallis sees her sister Cecilia strip off her clothes and plunge into the fountain in the garden of their country house. Watching her is Robbie Turner, her childhood friend who, like Cecilia, has recently come down from Cambridge. By the end of that day the lives of all three will have been changed forever. Atonement was shortlisted for the Booker Prize. 'A beautiful and majestic fictional panoramic' - John Updike 'The best thing he has ever written' - Observer",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=nB4DkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:e,published:"2013-01-07",publisher:"Clipper Audio",subtitle:f}}]}}},meta:{}}},prerenderedAt:1694069465585}}("movie","Atonement","series","Ian McEwan",null,"",1,"Anchor","A Novel"))